import logo from './logo.svg';
import 'antd/dist/antd.css';
import { Typography, Row, Col } from 'antd';

function App() {
  const { Title } = Typography;
  return (
    <>
    <Row align='middle'>
    <Col offset={12}>
      <Title>CS 338 Bias Project</Title>
      </Col>
    </Row>
    </>
  );
}

export default App;
